$OBJ = {
	'win' : $(window),
	'doc' : $(document),
	'html' : $('html')
}

function winW(){//창 너비
	return $OBJ.win.width();
}

function winH(){// 창 높이
	return $OBJ.win.height();
}

function winSh(){// 스크롤 값
	return $OBJ.win.scrollTop();
}

function mathceil(num){// 소수 점 올림
	return Math.ceil(num);
}

function mathfloor(num){// 소수 점 절사
	return Math.floor(num);
}

function mChk(){// 모바일 체크
	return $('#mchk').is(':visible');
}

var zoom = {
	init : function(){
		this.action();
	},
	action : function(){
		var a = $('#head');
		var zIn = a.find('.zoomin');
		var zOut = a.find('.zoomout');
		var zReset = a.find('.zoomdefault');

		var nowZoom = 100;

		function zoomOut() {// 화면크기축소
			 nowZoom = nowZoom - 5;
			 if(nowZoom <= 80) nowZoom = 80;// 화면크기 최대 축소율 70%
			 zooms();
		}

		function zoomIn() {// 화면크기확대
			 nowZoom = nowZoom + 5;
			 if(nowZoom >= 120) nowZoom = 120;// 화면크기 최대 확대율 200%
			 zooms();
		}

		function zoomReset() {
			 nowZoom = 100;// 원래 화면크기로 되돌아가기
			 zooms();
		}

		function zooms() {
			 document.body.style.zoom = nowZoom + '%';
			 if(nowZoom == 70) {
					alert('더 이상 축소할 수 없습니다.');// 화면 축소율이 70% 이하일 경우 경고창
			 }
			 if(nowZoom == 200) {
					alert('더 이상 확대할 수 없습니다.');// 화면 확대율이 200% 이상일 경우 경고창
			 }
		}

		zIn.on('click',function(){
			zoomIn();
		});

		zOut.on('click',function(){
			zoomOut();
		});

		zReset.on('click',function(){
			zoomReset()
		});

	}
}


var head = {
	init : function(){
		this.action();
	},
	action : function(){
		var a = $('#head');
		var gnb = a.find('.gnb');
		var mnu = a.find('.mnu');
		var snb = $('#svis .snb a');

		gnb.on('mouseenter focusin',function(){
			$OBJ.html.addClass('gnbOn');
		}).on('mouseleave focusout',function(){
			$OBJ.html.removeClass('gnbOn');
		}).on('click','> li > a',function(){
			if(winW() <= 1024){
				$(this).closest('li').toggleClass('active').siblings().removeClass('active');
				return false;
			}
		}).on('click','a',function(){
			var txt = $(this).attr('href');
			var hash = txt.split('#');
			if(hash[1] == 'goal') {
				$OBJ.html.removeClass('gnbOn');
				$OBJ.html.toggleClass('navOn');
			}
		});

		mnu.on('click',function(){
			$OBJ.html.toggleClass('navOn');
		});

		snb.on('click',function(){
			$(this).addClass('active').siblings().removeClass('active');
		});

		$('.__vision .goal').appear();
		$('.__vision .goal').on('appear',function(){
			gnb.find('> li').eq(2).find('ul > li').eq(1).addClass('active').siblings().removeClass('active');
			snb.eq(1).addClass('active').siblings().removeClass('active');
		}).on('disappear',function(){
			gnb.find('> li').eq(2).find('ul > li').eq(0).addClass('active').siblings().removeClass('active');
			snb.eq(0).addClass('active').siblings().removeClass('active');
		});

	}
}


var vis = {
	init : function(){
		this.action();
	},
	action : function(){
		var a = $('#vis');
		var roll = a.find('.roll');
		var auto = a.find('.auto');

		function visActive(num){
			setTimeout(function(){
				roll.find('.slick-current').addClass('active');
			},300);
			setTimeout(function(){
				roll.find('.slick-current').siblings().removeClass('active');
			},500);
		}

		roll.on('init', function(event, slick){
			visActive(0);
		});

		roll.slick({
			arrows: true,
			dots: true,
			appendDots: a.find('.page'),
			infinite: true,
			speed: 1000,
			fade: true,
			autoplay: true,
			pauseOnHover: false,
			pauseOnFocus: false,
			autoplaySpeed: 4000
		});

		roll.on('beforeChange', function(event, slick, currentSlide, nextSlide){
			visActive(nextSlide);
		});

		auto.on('click',function(){
			$(this).toggleClass('active');
			if($(this).hasClass('active')){
				roll.slick('slickPause');
			}else{
				roll.slick('slickPlay');
			}
		});

	}
}


var gotop = {
	init : function(){
		this.action();
	},
	action : function(){
		var a = $('#gotop');

		function goTopShow(){
			if(winSh() > 100){
				a.addClass('show');
			}else{
				a.removeClass('show');
			}
		}

		a.on('click',function(){
			$.scrollTo($OBJ.html,300);
		});

		$OBJ.win.on('load scroll',function(){
			goTopShow();
		});

	}
}


var ele = {
	init : function(){
		this.action();
	},
	action : function(){
		var a = $('#ele');
		var roll = a.find('.roll');
		var auto = a.find('.auto');
		var prev = a.find('.prev');
		var next = a.find('.next');

		roll.slick({
			vertical: true,
			arrows: false,
			dots: false,
			infinite: true,
			speed: 500,
			autoplay: true,
			pauseOnHover: false,
			pauseOnFocus: false,
			autoplaySpeed: 4000
		});

		auto.on('click',function(){
			$(this).toggleClass('active');
			if($(this).hasClass('active')){
				roll.slick('slickPause');
			}else{
				roll.slick('slickPlay');
			}
		});

		prev.on('click',function(){
			roll.slick('slickPrev');
		});

		next.on('click',function(){
			roll.slick('slickNext');
		});

	}
}


